import React, { useState, useRef, useEffect } from "react";

const Order = ({ orderObject }) => {
  // States
  const [open, setOpen] = useState(false);

  return (
    <React.Fragment>
      <div className="order" onClick={setOpen(!open)}></div>
    </React.Fragment>
  );
};

export default Order;
